import { Stepper, Step } from "react-form-stepper";
import './Sample2.css'
const Sample2 = (props) => {
  return <section className="sec">
    <Stepper activeStep={props.activeStep}>
      <Step activeBgColor='#ff7f27' index={3} label="ثبت چک لیست" />
      <Step index={2} label="تعریف افراد" />
      <Step ff7f27 index={1} label="تعریف زون ها" />
      <Step activeBgColor='ff7f27' index={0} label="اطلاعات اصلی" />
    </Stepper>
  </section>;
};

export default Sample2;
